pageProps.query:
    query page($relativePath: String!) {
  page(relativePath: $relativePath) {
    ... on Document {
      _sys {
        filename
        basename
        breadcrumbs
        path
        relativePath
        extension
      }
      id
    }
    ...PageParts
  }
}

    fragment PageParts on Page {
  seo {
    __typename
    title
    description
  }
  og {
    __typename
    site_name
    url
    type
    image
  }
  page_content {
    __typename
    section {
      __typename
      id
      block {
        __typename
        text_block {
          __typename
          cols {
            __typename
            num
            push_left
            push_right
          }
          format
          heading
          subheading
          description
          cta {
            __typename
            button {
              __typename
              action
              url
              text
              theme
            }
          }
        }
      }
    }
  }
}
